import React from 'react';
import { styled } from 'styled-components';

const Container = styled.div`
  border: 1px solid #eee;
  width: 100%;
  height: 60vh;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const Content = styled.div`
  border: 1px solid red;
  width: 400px;
  height: 700px;
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const LoginTitle = styled.div`
  margin: 50px;
  font-weight: bold;
  font-size: 20px;
`;

const Form = styled.form`
  width: 100%;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
`;

const Input = styled.input`
  margin-bottom: 20px;
  height: 50px;
  border-radius: 50px;
  padding: 0 10px;
  border: none;
  background-color: #eee;
`;

const Button = styled.button`
  margin-bottom: 20px;
  height: 50px;
  border-radius: 50px;
  border: none;
  background-color: #000;
  color: #fff;
`;

const Nav = styled.div`
  margin: 10px 0;
  span {
    font-size: 12px;
    margin: 0 5px;
    a {
      text-decoration: none;
      color: #000;
    }
  }
`;

const LoginSelect = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  div {
    margin: 20px 0;
    font-size: 12px;
  }
`;

const Logo = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 250px;
  img {
    border-radius: 50%;
    width: 55px;
    height: 55px;
  }
`;

const Join = styled.div`
  border: 1px solid red;
`;

const Login = () => {
  return (
    <Container>
      <Content>
        <LoginTitle>
          LOGIN
        </LoginTitle>
        <Form>
          <Input type='text' placeholder='아이디'/>
          <Input type='text' placeholder='비밀번호'/>
          <Button>로그인</Button>
        </Form>
        <Nav>
          <span><a href='#'>아이디찾기</a></span>
          <span><a href='#'>비밀번호찾기</a></span>
          <span><a href='#'>회원 혜택보기</a></span>
        </Nav>
        <LoginSelect>
          <div>
            sns 계정으로 로그인하기
          </div>
          <Logo>
            <img src='https://wiisnt.co.kr/images/cm_icon_social_kakao_login-.svg'/>
            <img src='https://wiisnt.co.kr/images/cm_icon_social_naver_login-.svg'/>
            <img src='https://wiisnt.co.kr/images/cm_icon_social_facebook_login-.svg'/>
            <img src='https://wiisnt.co.kr/images/cm_icon_social_google_login-.svg'/>
          </Logo>
        </LoginSelect>
        <Join>
          <div>
            아직 와릿이즌 회원이 아니신가요?
          </div>
          <Button2>회원가입 하기</Button2>
          <div>
            비회원 주문조회
          </div>
        </Join>
      </Content>
    </Container>
  )
}

export default Login;
